// src/components/Login.js
import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate,Link } from 'react-router-dom';
function Login() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  const handleLogin = async () => {
    try {
        debugger
      const res = await axios.post('https://localhost:44357/api/Auth/login', {
        username,
        password
      });
      alert(res.data.message);
      navigate('/dashboard');
    } catch (err) {
      alert('Login failed');
    }
  };
  return (
    <>
     <div className="login-select">
      <div className="login-mdv">
        <div className="login-sbdv">
          <div className="login-item">
            <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-envelope-at-fill" viewBox="0 0 16 16">
  <path d="M2 2A2 2 0 0 0 .05 3.555L8 8.414l7.95-4.859A2 2 0 0 0 14 2zm-2 9.8V4.698l5.803 3.546zm6.761-2.97-6.57 4.026A2 2 0 0 0 2 14h6.256A4.5 4.5 0 0 1 8 12.5a4.49 4.49 0 0 1 1.606-3.446l-.367-.225L8 9.586zM16 9.671V4.697l-5.803 3.546.338.208A4.5 4.5 0 0 1 12.5 8c1.414 0 2.675.652 3.5 1.671"/>
  <path d="M15.834 12.244c0 1.168-.577 2.025-1.587 2.025-.503 0-1.002-.228-1.12-.648h-.043c-.118.416-.543.643-1.015.643-.77 0-1.259-.542-1.259-1.434v-.529c0-.844.481-1.4 1.26-1.4.585 0 .87.333.953.63h.03v-.568h.905v2.19c0 .272.18.42.411.42.315 0 .639-.415.639-1.39v-.118c0-1.277-.95-2.326-2.484-2.326h-.04c-1.582 0-2.64 1.067-2.64 2.724v.157c0 1.867 1.237 2.654 2.57 2.654h.045c.507 0 .935-.07 1.18-.18v.731c-.219.1-.643.175-1.237.175h-.044C10.438 16 9 14.82 9 12.646v-.214C9 10.36 10.421 9 12.485 9h.035c2.12 0 3.314 1.43 3.314 3.034zm-4.04.21v.227c0 .586.227.8.581.8.31 0 .564-.17.564-.743v-.367c0-.516-.275-.708-.572-.708-.346 0-.573.245-.573.791"/>
</svg>
            <img
              src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-login-form/draw2.svg"
              className="img-fluid"
              alt="Phone"
            />
            <form className="form-inputs">
              {/* Email input */}
              <div className="form-outline mb-4">
                <input type="text" id='UserId' placeholder="Enter Email ID"  className="form-control form-control-lg" required onChange={(e) => setUsername(e.target.value)} />
                <label className="form-label" htmlFor="UserId">
                  Email ID
                </label>
              </div>

              {/* Password input */}
              <div className="form-outline mb-4">
                    <input type="password" id='Password' placeholder="Password" required  className="form-control form-control-lg" onChange={(e) => setPassword(e.target.value)} />
                <label className="form-label" htmlFor="Password">
                  Password
                </label>
              </div>

              {/* Remember Me + Forgot */}
              <div className="form-options">
                <div className="form-check">
                  <input
                    className="form-check-input"
                    type="checkbox"
                    id="form1Example3"
                    defaultChecked
                  />
                  <label className="form-check-label" htmlFor="form1Example3">
                    Remember me
                  </label>
                </div>
                <a href="#!" className="forgot-password">
                  Forgot password?
                </a>
              </div>

              {/* Submit button */}
              <button type="submit" className="btn-submit">
                Sign in
              </button>
              <div className="divider">
                <p>OR</p>
               </div>
              <button className="btn-social facebook">
                <i className="fab fa-facebook-f"></i> Continue with Facebook
              </button>
              <button className="btn-social twitter">
                <i className="fab fa-twitter"></i> Continue with Twitter
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
      {/* <div>
      <h2>Login</h2>
      <input type="text" placeholder="Username" onChange={(e) => setUsername(e.target.value)} />
      <input type="password" placeholder="Password" onChange={(e) => setPassword(e.target.value)} />
      <button onClick={handleLogin}>Login</button>
    </div> */}
    </>
  
  );
}

export default Login;
